    "privacyTerms" : MessageLookupByLibrary.simpleMessage("Zgodnie z wietnamskim prawem dane użytkowników, takie jak imiona i nazwiska, adresy e-mail, hasła i data urodzenia, mogą zostać sklasyfikowane jako „dane osobowe”.\n\n W szczególności,\n (a) Zgodnie z dekretem 72/2013, dane osobowe definiuje się jako informacje, które są dołączone do identyfikacji tożsamości i danych osobowych osoby, w tym imię i nazwisko, wiek, adres, numer dowodu osobistego, numer telefonu, adres e-mail i inne informacje zgodnie z prawem\n\n (b) Zgodnie z okólnikiem 25/2010 dane osobowe oznaczają informacje wystarczające do dokładnej identyfikacji osoby, które obejmują co najmniej jeden z następujących danych: imię i nazwisko, data urodzenia, zawód, stanowisko, adres kontaktowy, adres e-mail, numer telefonu, tożsamość numer karty i numer paszportu. Informacje dotyczące prywatności obejmują dokumentację medyczną, rejestr płatności podatków, numer karty ubezpieczenia społecznego, numer karty kredytowej i inne tajemnice osobiste.\n\n Okólnik 25 dotyczy gromadzenia i wykorzystywania danych osobowych przez strony internetowe obsługiwane przez władze Wietnamu. Okólnik 25 nie ma bezpośredniego zastosowania do gromadzenia i wykorzystywania danych osobowych przez strony internetowe obsługiwane przez podmioty pozarządowe. Jednak przepisy okólnika 25 można zastosować przez analogię. Ponadto jest prawdopodobne, że podmiot pozarządowy będzie podlegał tym samym lub bardziej rygorystycznym standardom, jak te, które mają zastosowanie do podmiotu rządowego."),
